import React from 'react'
import './rightpart.css';
function MiddRight({className}) {
    var obj_list=["1W","1M","3M","1Y","ALL"];
    function caller(e){
      var v = e.target;
      v.style.transition="all .3s";
      var slarr=(v.parentElement.childNodes);
      console.log(slarr);
      slarr.forEach((e)=>{
          console.log(e);
          e.style.background="transparent";
          e.style.fontSize = "14px";
          e.style.color = "black";
      })
      v.style.width="53px";
      v.style.height = "32px";
      v.style.background="#3247E5";
      v.style.color="white";
      v.style.fontSize="13px";
       v.style.borderRadius= "16px";
    }
  return <div className={className}>
    <div className='upper_part'>
        <h1 id='uph'>TIMELINE </h1>
    </div>
    <div className='Main_circle'>
        <div className='mc_1'>
            <div className='slide'>
                {
                    obj_list.map((e,i)=>{
                        var a=`_0${i}0`;
                        return <div key={i} id={a} onClick={(e)=>{
                            return caller(e);
                        }}   className='buttons_'>{e} </div>
                    })
                }
            </div>
            <div className='mc_2'>
                <div className='mc_3'>

                </div>
            </div>
        </div>
    </div>
    {/* <div className='copy' ></div> */}
  </div>;
}
export default MiddRight;
